import React, { Component } from 'react'

 class MenuOps extends Component {
    render() {
        return (
            <div>
                <a style={menuStyle} href="/pos">POS</a>
                <br></br>
                <a style={menuStyle} href="/pos">SELLS GOALS</a>

                <a style={menuStyle} href="/pos">EMPLOYEES</a>
                <a style={menuStyle} href="/pos">CUSTOMER INFO</a>
                <a style={menuStyle} href="/pos">TRANSACTION HISTORY</a>
            </div>
        )
    }
}

const menuStyle ={
    color: "blue"
}

export default MenuOps;
